import "./input.css";
const input = () => {
    return (<div className="input">
        <div className="input1"> <input  id="input1" type="txt" placeholder="请输入统一认证码"></input></div>
       
        <input  id="input2" type="password" placeholder="请输入密码"></input>
        </div>)
}
export default input;
